## MCU's

[mcu]
serial: /dev/serial/by-id/usb-Klipper_lpc1768_0E100111018139AF8B50075CC12000F5-if00

[mcu rpi]
serial: /tmp/klipper_host_mcu

## Printer settings

[printer]
kinematics: corexz
max_velocity: 300
max_accel: 10000
max_accel_to_decel: 10000
max_z_velocity: 50
max_z_accel: 1000
square_corner_velocity: 5

## Stepper settings

[stepper_x]
step_pin: P2.2
dir_pin: P2.6
enable_pin: !P2.1
rotation_distance: 40
microsteps: 16
endstop_pin: ^P1.29
position_endstop: 250
position_min: 0
position_max: 250
homing_speed: 70
homing_positive_dir: true
homing_retract_dist: 2.5

[tmc2209 stepper_x]
uart_pin: P1.17
tx_pin: P4.29
run_current: 0.5
hold_current: 0.3
interpolate: True
stealthchop_threshold: 1

[stepper_y]
step_pin: P0.19
dir_pin: !P0.20
enable_pin: !P2.8
rotation_distance: 40
microsteps: 16
endstop_pin: ^P1.27
position_endstop: 232
position_min: -25
position_max: 232
homing_speed: 70
homing_positive_dir: true
homing_retract_dist: 2.5

[tmc2209 stepper_y]
uart_pin: P1.15
tx_pin: P1.16
run_current: 0.5
hold_current: 0.3
interpolate: true
stealthchop_threshold: 1

[stepper_z]
step_pin: P0.22
dir_pin: !P2.11
enable_pin: !P0.21
rotation_distance: 40
microsteps: 16
endstop_pin: ^P1.28
position_endstop: -2.6
position_min: -2.6
position_max: 252
homing_speed: 35    
homing_retract_dist: 2.5

[tmc2209 stepper_z]
uart_pin: P1.10
tx_pin: P1.14
run_current: 0.5
hold_current: 0.3
interpolate: True
stealthchop_threshold: 1

[probe]
Pin: ^P1.25
x_offset: 0.0
y_offset: 34.5
z_offset: 2.600
speed: 3
samples_result: median
samples_tolerance: 0.05
samples_tolerance_retries: 2

## Extruder settings

[extruder]
#max_extrude_only_distance: 100.0
max_extrude_cross_section: 50
max_extrude_only_distance: 700.00
step_pin: P2.13
dir_pin: P0.11
enable_pin: !P2.12
step_distance: 0.00242
nozzle_diameter: 0.400
filament_diameter: 1.750
heater_pin: P2.7
pressure_advance: 0.045
pressure_advance_smooth_time: 0.040
sensor_type: PT1000
pullup_resistor: 1000
sensor_pin: P0.25
min_temp: 0
max_temp: 270

[tmc2209 extruder]
uart_pin: P1.8
tx_pin: P1.9
microsteps: 16
run_current: 0.8
hold_current: 0.4
interpolate: True

[firmware_retraction]
retract_length: 0.75
retract_speed: 30
unretract_extra_length: 0
unretract_speed: 25

## Bed settings

[bed_mesh]
speed: 200
horizontal_move_z: 3.25
mesh_min: 20,13.5
mesh_max: 230,224.5
probe_count: 7
relative_reference_index: 24
algorithm: bicubic
fade_start: 1
fade_end: 10
fade_target: 0

[heater_bed]
heater_pin: P2.5
sensor_type: ATC Semitec 104GT-2
sensor_pin: P0.23
min_temp: 0
max_temp: 130
pwm_cycle_time: 0.0166

[verify_heater heater_bed]
max_error: 180
check_gain_time: 120
hysteresis: 15
heating_gain: 2

## Additional temperature sensors

[temperature_sensor chamber_temp_at_xchain]
sensor_type: ATC Semitec 104GT-2
sensor_pin: P0.24
min_temp: 0
max_temp: 90

[temperature_sensor y_extrusion]
sensor_type: DS18B20
serial_no: 28-0301a27908fd 
sensor_mcu: rpi

[temperature_sensor z_extrusion]
sensor_type: DS18B20
serial_no: 28-0301a279f7e4 
sensor_mcu: rpi

## Fans
### Electronics fan
[controller_fan my_controller_fan]
pin: P1.24
