pin: P2.4
max_power: 1.0
kick_start_time: 0.100
heater: extruder
heater_temp: 50.0
fan_speed: 1.0

## Misc settings

[virtual_sdcard]
path: /home/pi/sdcard

[pause_resume]
[respond]

